script: |
  super -f text -I q5450.spq | sort > q5450.out

inputs:
  - name: q5450.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE - + col1 NOT IN ( col2 + + 72 * - col0 + col0 / - - col0, col0, - - 10 );
  - name: tab1

outputs:
  - name: q5450.out
    data: |
      51	14	96
      85	5	59
      91	47	68
